import { Add } from './Login';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
       <Header />
      <Routes>

          <Route path="/add" element={<Login />} />
          <Route path="/update" element={<Login />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Login />} />


      </Routes>


      </BrowserRouter>

    </div>
  );
}

export default App;
